INSERT INTO guserdb2.userinfo (uid, name, nickname, showname, idtype, identityid, gender, birthday, college, address, qq, wx, sina, aisle, othernicks, otheravatar, country, soldier, passport, msn, freeze, avatarbig, avatar, avatarlittle, original, summary, job, department, company, domain, honor, education, work, createtime, updatetime, oid, status) VALUES ('2b3e16d2c57d4f14a8244924dc4ae39f', '顾雏军', 'Chujun Gu', '顾雏军', 0, '321102195905050413', 1, null, null, null, null, null, null, null, null, null, null, null, null, null, 0, '/imgs/user/14/avatar/140323155429388_o_58_-10_238_170_o.jpg', '/imgs/user/14/avatar/140323155429388_o_58_-10_238_170_o.jpg', '/imgs/user/14/avatar/140323155429388_o_58_-10_238_170_50_50.jpg', null, '    超天才网根据顾雏军先生的策划，创立了超天才职业经理人培训学院，并聘请顾雏军先生为该学院的裁判管理委员会主席。顾雏军先生是格林柯尔集团的创始人，同时曾是格林柯尔集团香港上市公司（香港交易所交易代码8056）、科龙电器（股票代码000921、香港交易所交易代码0921）、美菱电器（股票代码000521）、亚星客车（股票代码600213）、襄阳轴承（股票代码000678）5家上市公司的董事长。顾雏军先生被评为2003CCTV中国经济年度人物，他曾经控制中国冰箱市场半壁江山，拥有世界冰箱四分之一的生产能力，他是制冷专家，更是投资赢家。2002-2005年间，顾雏军先生曾亲自教授30期科龙MBA培训班学员（入学条件是学员本身必须具有MBA学位证书），共培养海内外优秀人才870余人。众所周知，顾雏军先生经历了过山车般的人生考验，对企业致命风险的防范和管控积累了刻骨铭心的的经验和教训，而这正是现代中国企业家成长为国际企业家过程中的最宝贵的财富。本网站特邀顾雏军先生作为超天才网企业家培训学院院长，致力于造就一批屹立于世界之林的商界领袖。', '名誉董事长', '', '超天才技术开发（北京）有限责任公司', null, null, null, null, '2013-12-20 07:12:28', '2016-08-16 02:25:21', 0, null);
